import { Box, Button, css, Grid, Skeleton, useTheme } from '@mui/material'

import React from 'react'
import { Background } from '../../../components/Background'
import { VouchForm } from './VouchForm'
import { VouchTable } from './VouchTable'
import { ScoreSDK } from '../../score/components/ScoreSDK'

export function Vouch(): React.ReactElement {

  const styles = {
    wrapper: css`
      position: relative;
      padding-bottom: 260px;
      max-width: 1307px;
      margin: 0 auto;
    `,
    poolWrapper: css`
      position: relative;
      margin-bottom: 40px;
      z-index: 1;
    `,
  }

  return (
    <Box css={styles.wrapper}>
      <Box css={styles.poolWrapper}><VouchForm /></Box>
      {/* <ScoreSDK /> */}
      <Background />
    </Box>
  )
  }
